sql_queries:
SELECT COUNT(`No. in season`) AS Total_Episodes, AVG(`No. in series`) AS Average_Seasonal_Position
FROM `table_1_10610087_6`
WHERE `Original air date` >= 'June1,2007' AND `Original air date` <= 'December31,2007';

SELECT `Network`, COUNT(`Season`) as `Number of Seasons`, AVG(`Viewers (in millions)`) as `Average Viewers`, MAX(`Viewers (in millions)`) as `Max Viewers`, MIN(`Viewers (in millions)`) as `Min Viewers`
FROM `table_1_1009087_1`
GROUP BY `Network`;

SELECT `Year`, `Wins (Majors)` as `Major Wins`, `Top 10` as `Top 10 Finishes`, `Top 25` as `Top 25 Finishes`, `Earnings ($)`, `Money list rank`, `Adjusted scoring average (rank)`
FROM `table_1_11570261_6`
ORDER BY `Year` DESC;

SELECT COUNT(`Player`) AS `Number_of_Players`, `Position`, AVG(`Pick #`) AS `Average_Pick_Number`
FROM `table_1_10812938_4`
GROUP BY `Position`;

SELECT `League`, `Sport`, `Country`, `Season`, `Games`, `Average attendance`, `Total attendance`
FROM (
    SELECT *, AVG(`Total attendance`) OVER (PARTITION BY `Country`) AS `Avg Total Attendance per Country`
    FROM (
        SELECT *, AVG(`Average attendance`) OVER () AS `Global Avg Attendance`
        FROM `table_1_10815352_1`
    )
) t
WHERE `Total attendance` > (t.`Avg Total Attendance per Country`) * 1.5
ORDER BY `Total attendance` DESC;

SELECT COUNT(*) as `Total Former Members`, AVG(`Enrollment`) as `Average Enrollment`, MAX(`Founded`) as `Oldest Institution`, MIN(`Founded`) as `Youngest Institution`, GROUP_CONCAT(DISTINCT `Current Conference`) as `Distinct Conferences` 
FROM `table_1_10577579_3`
WHERE `Left` IS NOT NULL;

SELECT COUNT(*) as Total_Guards FROM (
    SELECT * FROM ` Utah Jazz all-time roster`
    WHERE `Position` = 'Guard' AND `Years for Jazz` >= 10
) AS Guard_Roster;

SELECT COUNT(*) as `Total Episodes`, SUM(CAST(REPLACE(`U.S. viewers (million)`, ',', '') AS REAL)) as `Total Viewers (in millions)` 
FROM `table_1_10413597_5`
WHERE `U.S. viewers (million)`!= 'N/A';

SELECT COUNT(`Number of Australians involved`) AS Total_Australians, AVG(`Number of Australians involved`) AS Average_Australians, MAX(`Number of Australians involved`) AS Maximum_Australians, MIN(`Number of Australians involved`) AS Minimum_Australians, SUM(`Number of Australians involved`) AS Total_Australians_Sum
FROM `table_1_10121127_1`
WHERE `Dates of Australian involvement`!= 'None';

SELECT COUNT(`No. in season`) AS `Number of Episodes per Season`, AVG(`U.S. viewers (millions)`) AS `Average Viewership per Episode`, MAX(`U.S. viewers (millions)`) AS `Highest Viewership`, MIN(`U.S. viewers (millions)`) AS `Lowest Viewership`
FROM (
    SELECT `No. in season`, `U.S. viewers (millions)`
    FROM `table_1_10715317_2`
    GROUP BY `No. in season`
) AS `season_viewers`;

SELECT `Species`, AVG(`Sepal length`) as `Avg Sepal Length`, AVG(`Sepal width`) as `Avg Sepal Width`, AVG(`Petal length`) as `Avg Petal Length`, AVG(`Petal width`) as `Avg Petal Width`
FROM `table_1_10477224_1`
GROUP BY `Species`;

SELECT AVG(`League Goals`) as `Average League Goals`, SUM(`Cup Goals`) as `Total Cup Goals`
FROM (
    SELECT `League Goals`, `Cup Goals`
    FROM `table_1_10556257_1`
    WHERE `Season` BETWEEN '1910-11' AND '1923-24'
) AS subquery;

SELECT `Season`, COUNT(`MLS Cup Winner`) as `Wins`, COUNT(`MLS Supporters Shield Winner`) as `Shield Wins`
FROM `table_1_11148572_1`
GROUP BY `Season`;

SELECT COUNT(*) as Total_Games, AVG(`Attendance`) as Average_Attendance, MAX(`Attendance`) as Highest_Attendance, MIN(`Attendance`) as Lowest_Attendance, SUM(CASE WHEN `Result` LIKE '%W%' THEN 1 ELSE 0 END) as Wins, SUM(CASE WHEN `Result` LIKE '%L%' THEN 1 ELSE 0 END) as Losses, SUM(CASE WHEN `Result` LIKE '%OT%' THEN 1 ELSE 0 END) as Overtime_Losses, GROUP_CONCAT(DISTINCT `Game site`) as Unique_Game_Sites
FROM `table_1_11452830_2`
WHERE `Week` >= 1 AND `Week` <= 15;

SELECT COUNT(`Rating`) as Total_Ratings, AVG(`Rating`) as Average_Rating, MAX(`Rating`) as Highest_Rating, MIN(`Rating`) as Lowest_Rating, SUM(`Viewers (m)`) as Total_Viewers
FROM `table_1_11274401_3`
WHERE `Rating` <> 'TBA';

SELECT `Tournament`, COUNT(*) as `Number_of_Tournaments`, AVG(`Purse( $ )`) as `Average_Purse`, MAX(`Purse( $ )`) as `Highest_Purse`
FROM `table_1_11621873_1`
GROUP BY `Tournament`;
